import{_ as e,c as s,o as t,ag as i}from"./chunks/framework.DRADY2L-.js";const u=JSON.parse('{"title":"Installation","description":"","frontmatter":{},"headers":[],"relativePath":"guide/installation.md","filePath":"guide/installation.md"}'),n={name:"guide/installation.md"};function l(o,a,r,p,d,h){return t(),s("div",null,[...a[0]||(a[0]=[i(`<h1 id="installation" tabindex="-1">Installation <a class="header-anchor" href="#installation" aria-label="Permalink to &quot;Installation&quot;">​</a></h1><p>qs-jwt does not need to be installed.<br> It is a standalone, cross-platform executable that is just downloaded and executed.</p><p>The latest version is always available from the <a href="https://github.com/ptarmiganlabs/qs-jwt/releases" target="_blank" rel="noreferrer">download page</a>.</p><p>Make sure to check for new versions (and star the <a href="https://github.com/ptarmiganlabs/qs-jwt" target="_blank" rel="noreferrer">GitHub repositry</a> and subscribe to updates!) - new features are added and security updates applied.</p><h2 id="download" tabindex="-1">Download <a class="header-anchor" href="#download" aria-label="Permalink to &quot;Download&quot;">​</a></h2><ol><li>Go to the <a href="https://github.com/ptarmiganlabs/qs-jwt/releases" target="_blank" rel="noreferrer">releases page</a></li><li>Download the appropriate binary for your operating system. Windows, macOS and Linux supported.</li></ol><div class="info custom-block"><p class="custom-block-title">macOS</p><p>Currently (August 2025) only a macOS x64 binary is available, Apple Silicon (arm64) version coming.</p></div><h2 id="platform-specific-notes" tabindex="-1">Platform-specific Notes <a class="header-anchor" href="#platform-specific-notes" aria-label="Permalink to &quot;Platform-specific Notes&quot;">​</a></h2><h3 id="windows" tabindex="-1">Windows <a class="header-anchor" href="#windows" aria-label="Permalink to &quot;Windows&quot;">​</a></h3><div class="warning custom-block"><p class="custom-block-title">Windows operating systems</p><p>Don&#39;t forget to unblock the downloaded qs-jwt ZIP file before unzipping it.<br> Failing to unblock it may prevent proper execution of qs-jwt.exe.</p><p>To unblock: Right-click the ZIP file → Properties → Check &quot;Unblock&quot; → OK</p></div><h3 id="macos" tabindex="-1">macOS <a class="header-anchor" href="#macos" aria-label="Permalink to &quot;macOS&quot;">​</a></h3><p>The macOS executable binary is signed and notarized by Apple&#39;s standard process.<br> A warning may still be shown first time the app is started. This is expected and normal.</p><h3 id="linux" tabindex="-1">Linux <a class="header-anchor" href="#linux" aria-label="Permalink to &quot;Linux&quot;">​</a></h3><p>The Linux binary should work on most modern distributions. Make sure to make it executable:</p><div class="language-bash vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">chmod</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> +x</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> qs-jwt-linux</span></span></code></pre></div><h2 id="verify-installation" tabindex="-1">Verify Installation <a class="header-anchor" href="#verify-installation" aria-label="Permalink to &quot;Verify Installation&quot;">​</a></h2><p>Once downloaded, you can verify the installation by running:</p><div class="language-bash vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#6A737D;--shiki-dark:#6A737D;"># Windows</span></span>
<span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">qs-jwt.exe</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;"> --version</span></span>
<span class="line"></span>
<span class="line"><span style="--shiki-light:#6A737D;--shiki-dark:#6A737D;"># macOS/Linux</span></span>
<span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">./qs-jwt</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;"> --version</span></span></code></pre></div><p>This should display the version number and confirm that qs-jwt is working correctly.</p><h2 id="next-steps" tabindex="-1">Next Steps <a class="header-anchor" href="#next-steps" aria-label="Permalink to &quot;Next Steps&quot;">​</a></h2><p>Now that you have qs-jwt installed, you can:</p><ul><li><a href="/guide/concepts.html">Learn about qs-jwt concepts</a></li><li><a href="/guide/commands.html">Explore the available commands</a></li><li><a href="/guide/examples.html">Try some examples</a></li></ul>`,22)])])}const b=e(n,[["render",l]]);export{u as __pageData,b as default};
